import { MdLocalMovies } from "react-icons/md";
import { BiUpArrow } from "react-icons/bi";
let button = "";
const Button = props => {
  if (!props.btnState) {
    button = (
      <button onClick={props.onClick} className={props.btnClass}>
        Add <MdLocalMovies />
      </button>
    );
  } else {
    button = (
      <button onClick={props.onClick} className={props.btnClass}>
        <></>
        <></>
        <></>
        <BiUpArrow />
      </button>
    );
  }
  return <div>{button}</div>;
};

export default Button;
